package com.educaflow.common.pdf.impl.helper;

import java.io.ByteArrayInputStream;
import java.io.InputStream;
import java.util.Base64;

/**
 * Perfil del International Color Consortium
 * @author logongas
 */
public class IccProfile {
    
    private static final String iccStandardRedGreenBlueBase64="";

    public static InputStream getStandardRedGreenBlue() {
        byte[] decodedBytes = Base64.getDecoder().decode(iccStandardRedGreenBlueBase64);

        InputStream is=new ByteArrayInputStream(decodedBytes);

        return is;
    }
    
}
